pragma solidity ^0.8.0;

contract mappings {
    mapping(address => uint) saldos;

    function deposit() external payable {
        saldos[msg.sender] += msg.value;        
    }

    function balanceof() external view returns(uint256) {
        return saldos[msg.sender];
    }
}

